import React, { useState, useEffect } from "react";

const CanOpener = () => {
    const Participants = () => {};
    const [users, setUsers] = useState([]);
    const userList = users.map((user) => <li key={user}>{user}</li>);

    return <ul>{userList}</ul>;
};
export default CanOpener;
